CREATE 1ST TABLE- CALENDAR
*/ 
--Drop table if it exists
IF OBJECT_ID('calendar', 'U') IS NOT NULL
    DROP TABLE calendar;
GO
CREATE TABLE calendar (
    sale_date DATE NOT NULL PRIMARY KEY,
    month_name VARCHAR(510) NULL,
    quarter_ VARCHAR(510) NULL,
    year_ INT NULL,
    day_of_week VARCHAR(510) NULL
);

