    sale_id INT NOT NULL PRIMARY KEY,
    sale_date DATE NULL,
    customer_id INT NULL,
    product_id INT NULL,
    store_id INT NULL,
    quantity INT NULL,
    discount DECIMAL(5,2) NULL,
